  \"2015-09-01T18:17:13.925483\",\n\t\"name\": \"milk-marketing-order-statistics\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The statistical data generated through the
  administration of the Federal milk order program is recognized widely as one of
  the benefits of this program. These data provide comprehensive and accurate information
  on milk supplies, utilization, and sales, as well as class prices established under
  the orders and prices paid to dairy farmers (producers). The sources of this data
  are monthly reports of receipts and utilization, producer payroll reports, and reports
  of nonpool handlers filed by milk processors (handlers) subject to the provisions
  of the various milk orders. The local market administrator (MA) uses these reports
  to determine pool obligations under the order and to verify proper payments to producers.
  Auditors employed by the MA review handler records to assure the accuracy of reported
  information. Reporting errors are corrected; if necessary, pool obligations are
  revised.rnrnAfter the pool obligations have been determined the local market administrator
  summarizes the individual handler reports and submits a series of order summary
  reports to the Market Information Branch (MIB) in Dairy Programs. The MIB summarizes
  the individual order data and disseminates this information via monthly, bimonthly,
  and annual releases or publications. Since milk marketing order statistics are based
  on reports filed by the population of possible reporting firms and not a sample,
  these statistics are comprehensive. Also, since these individual firm reports are
  subject to audit and verification, these statistics are accurate.rnrnThe Federal
  milk order statistics database contains historical information, beginning in January
  2000, generated by the administration of the Federal milk order program. Most of
  the information in the database has been published previously by the Market Information
  Branch in Dairy Programs either on its web site or in the Dairy Market News Report.
  New users are encouraged to use the \"User Guide\" to learn how to navigate the
  search screens.  If you are interested in a description of the Federal milk order
  statistics program, or want current data, in ready made table form, use the \"Current
  Information\" link.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
